import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for navigation menu to load
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Find and click on Profile navigation item using multiple selector strategies
    const profileSelector = '.nav-item[data-view="profile"]';
    await page.waitForSelector(profileSelector, { timeout: 3000 });

    // Click using different strategy than previous attempts
    await page.click(profileSelector);

    // Wait for profile view to load
    await page.waitForTimeout(1000); // Brief pause for UI update

    // Verify profile view is active by checking for user info elements
    await page.waitForSelector('.user-info .username', { timeout: 3000 });

    // Take screenshot after successful navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract user profile information for verification
    const username = await page.$eval('.user-info .username', el => el.textContent.trim());
    const userHandle = await page.$eval('.user-info .user-handle', el => el.textContent.trim());

    return {
      success: true,
      action: "Clicked on Profile navigation item and loaded current user's profile",
      extractedData: {
        username: username,
        userHandle: userHandle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'step_error.png') });
    screenshots.push(path.join(screenshotsDir, 'step_error.png'));

    return {
      success: false,
      action: "Failed to click on Profile navigation item",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
